social_posts.post_text:
My new song "FLOWER IN BLOOM" is now available on all streaming platforms. This is a song about perseverance, I hope on the days you just don't feel like going any further, it inspires you to do just that. One moment you're getting beat up in the storm, the next your standing strong with the sun on your face, like a flower in bloom. As always, thanks for listening and have a beautiful day. 🌹☀️ 🙏🏻❤️🤙🏻😀✅ LINK IN BIO!

The people that helped me bring this song to life: 

@arinimusic : recording engineer/mixing
@seancatdrums : Drums 
@dave.shultz1 : bass 

Don't give up guys! Whatever you're doing, Keep going. #dantillerymusic #flowers #detroit #artist #singersongwriter #recordingartist #recordingstudio #newsong #mentalhealth #love
